import React, { Component, useReducer } from 'react';
import './App.css';

class App extends Component {

  state = {
    spartans: []
  }

  componentDidMount() {
    fetch('/spartans')
      .then(res => res.json())
      .then(spartans => this.setState({spartans}));
  }

  render(){
    return (
      <div className="App">
        <h1>Spartans</h1>

      </div>
    );
  }

}

export default App;
